import React from 'react';

const Contact = (props) => {
    return(
        <div 
            className = "ui raised very padded text container segment"
            style = {{marginTop: "80px"}}
        >
            <h3 className = "ui header">Contact</h3>
            <p>Contact Us here!</p>

        </div>
    )
}

export default Contact;
